import{_ as e,o as t,a as r,X as o}from"./chunks/framework.BPPv2K3c.js";const u=JSON.parse('{"title":"2024年11-12月振り返り","description":"","frontmatter":{"layout":"post","title":"2024年11-12月振り返り","category":"diary","tags":["diary"],"head":[["link",{"rel":"canonical","href":"https://www.codingfeline.com/2024/12/31/11to12-wrapup/"}],["meta",{"property":"og:url","content":"https://www.codingfeline.com/2024/12/31/11to12-wrapup/"}],["meta",{"property":"og:title","content":"2024年11-12月振り返り"}],["meta",{"property":"twitter:card","content":"summary_large_image"}],["meta",{"property":"twitter:site","content":"@_yshrsmz"}],["meta",{"property":"twitter:creator","content":"@_yshrsmz"}],["meta",{"property":"og:image","content":"https://www.codingfeline.com/2024/12/31/11to12-wrapup/ogp.png"}]]},"headers":[],"relativePath":"2024/12/31/11to12-wrapup/index.md","filePath":"posts/2024/2024-12-31-11to12-wrapup.md","date":{"time":"2024-12-31","string":"December 31, 2024","year":"2024","month":"12","day":"31"}}'),i={name:"2024/12/31/11to12-wrapup/index.md"};function n(h,a,l,s,c,p){return t(),r("div",null,[...a[0]||(a[0]=[o('<p>2024年の11月-12月を振り返るよ。<br> できれば続けていきたい</p><p><strong>目次</strong></p><nav class="table-of-contents"><ul><li><a href="#仕事">仕事</a></li><li><a href="#個人プロジェクト">個人プロジェクト</a></li><li><a href="#買った">買った</a><ul><li><a href="#nothing-ear">Nothing Ear</a></li><li><a href="#boardsource-rechteck-キーボード">Boardsource Rechteck キーボード</a></li></ul></li><li><a href="#観た">観た</a><ul><li><a href="#星街すいせいライブ">星街すいせいライブ</a></li><li><a href="#宝鐘マリンライブ">宝鐘マリンライブ</a></li><li><a href="#arcane">Arcane</a></li></ul></li><li><a href="#ゲームした">ゲームした</a></li><li><a href="#その他">その他</a><ul><li><a href="#シュトーレン食べた">シュトーレン食べた</a></li><li><a href="#ダニアレルギー">ダニアレルギー</a></li></ul></li></ul></nav><h2 id="仕事" tabindex="-1">仕事 <a class="header-anchor" href="#仕事" aria-label="Permalink to &quot;仕事&quot;">​</a></h2><p>だいぶ締め切り近づいてきて忙しい。本格稼働開始前に Fastify v5 に更新できたのはよかった。</p><h2 id="個人プロジェクト" tabindex="-1">個人プロジェクト <a class="header-anchor" href="#個人プロジェクト" aria-label="Permalink to &quot;個人プロジェクト&quot;">​</a></h2><p>細かいメンテ以外に進捗はない。</p><p><a href="/2024/11/11/android-sharedprefs-newline-spaces/">Omnitweety の不具合修正</a>とか、ブログの投稿一覧に年ごとの投稿件数表示したりとか。</p><p>技術系の記事3本書けたのはよかった。仕事も含めて GitHub の PR を定期的に振り返ると、結構ネタ転がってるもんだなあ、と感じた。</p><h2 id="買った" tabindex="-1">買った <a class="header-anchor" href="#買った" aria-label="Permalink to &quot;買った&quot;">​</a></h2><h3 id="nothing-ear" tabindex="-1">Nothing Ear <a class="header-anchor" href="#nothing-ear" aria-label="Permalink to &quot;Nothing Ear&quot;">​</a></h3><p>Amazon のブラックフライデーで購入。今まで使っていた Sony WF-1000XM4 の挙動がちょっと怪しくなってきたので。価格帯的にはだいぶ下がるんだけど、数年前のものだし ノイズキャンセリング性能的にも Nothing Ear でかなり満足している。</p><h3 id="boardsource-rechteck-キーボード" tabindex="-1">Boardsource Rechteck キーボード <a class="header-anchor" href="#boardsource-rechteck-キーボード" aria-label="Permalink to &quot;Boardsource Rechteck キーボード&quot;">​</a></h3><p>あまりの可愛さに一目惚れして購入。しかし当たり前だけど Ortholinear と比べると使い心地は劣る。Choc V1 スイッチだから、というのもあるかもしれない。ただ、当たり前だけど Kinesis Advantage 360 からこのキーボードに置き換えると机の広さに驚く。また一体型の Ortholinear キーボード使おうかなあ。</p><h2 id="観た" tabindex="-1">観た <a class="header-anchor" href="#観た" aria-label="Permalink to &quot;観た&quot;">​</a></h2><h3 id="星街すいせいライブ" tabindex="-1">星街すいせいライブ <a class="header-anchor" href="#星街すいせいライブ" aria-label="Permalink to &quot;星街すいせいライブ&quot;">​</a></h3><p>3days 配信で。</p><h3 id="宝鐘マリンライブ" tabindex="-1">宝鐘マリンライブ <a class="header-anchor" href="#宝鐘マリンライブ" aria-label="Permalink to &quot;宝鐘マリンライブ&quot;">​</a></h3><p>2days 配信で。親子連れも結構いたようで、ファン層の広さを感じた。</p><h3 id="arcane" tabindex="-1">Arcane <a class="header-anchor" href="#arcane" aria-label="Permalink to &quot;Arcane&quot;">​</a></h3><p>Netflix の LoL 前日譚。LoL 自体はほぼ知らないんだけど、特に知らなくても楽しめた。</p><h2 id="ゲームした" tabindex="-1">ゲームした <a class="header-anchor" href="#ゲームした" aria-label="Permalink to &quot;ゲームした&quot;">​</a></h2><p>あんましなかった。ゴッド・オブ・ウォー ラグナロクはセール中に買ったので来年やる。</p><h2 id="その他" tabindex="-1">その他 <a class="header-anchor" href="#その他" aria-label="Permalink to &quot;その他&quot;">​</a></h2><h3 id="シュトーレン食べた" tabindex="-1">シュトーレン食べた <a class="header-anchor" href="#シュトーレン食べた" aria-label="Permalink to &quot;シュトーレン食べた&quot;">​</a></h3><p>食べすぎると体調悪くなるので本数はだいぶ絞ったけど、今年も4本シュトーレン食べた。<br> 今年は本当に食べたいものだけ買ったので、体調のこと考えると来年以降もだいたいこのチョイスになると思う。</p><blockquote class="twitter-tweet" data-conversation="none"><p lang="ja" dir="ltr">今年もシュトーレンの季節がやってきましたが、今年はジョエル・ロブションの二本でフィニッシュかなー。遅延型アレルギーテストで麦系強めに出てたのでもう10本とかは食べられぬw <a href="https://t.co/EqV6tihkHk">pic.twitter.com/EqV6tihkHk</a></p>— せーい(CodingFeline) (@_yshrsmz) <a href="https://twitter.com/_yshrsmz/status/1864577274663850372?ref_src=twsrc%5Etfw">December 5, 2024</a></blockquote><p>やはりジョエル・ロブションは外せない。シュトーレンらしいシュトーレンかというとそうでもないんだけど、やはり圧倒的に美味しい。</p><blockquote class="twitter-tweet" data-conversation="none"><p lang="ja" dir="ltr">二本でフィニッシュと言ったな。あれは嘘だ。2024年三本目のシュトーレンはユヌクレの tea。やっぱこれスパイスと紅茶感の塩梅が素晴らしい <a href="https://t.co/uzF6GusBiz">pic.twitter.com/uzF6GusBiz</a></p>— せーい(CodingFeline) (@_yshrsmz) <a href="https://twitter.com/_yshrsmz/status/1867356656000291166?ref_src=twsrc%5Etfw">December 12, 2024</a></blockquote><p>ユヌクレの tea もスパイスと紅茶感がとてもよい。やはりこの二店舗のシュトーレンは外せない。</p><blockquote class="twitter-tweet" data-conversation="none"><p lang="ja" dir="ltr">2024 年四本目の <a href="https://twitter.com/hashtag/%E3%82%B7%E3%83%A5%E3%83%88%E3%83%BC%E3%83%AC%E3%83%B3?src=hash&amp;ref_src=twsrc%5Etfw">#シュトーレン</a> はカーベー・ケージのもの。これぞシュトーレン、という感じで大変おいしいのだが、残念ながら今年で閉店なのです <a href="https://t.co/0e1dc6CnBP">pic.twitter.com/0e1dc6CnBP</a></p>— せーい(CodingFeline) (@_yshrsmz) <a href="https://twitter.com/_yshrsmz/status/1870622912547573839?ref_src=twsrc%5Etfw">December 22, 2024</a></blockquote><p>三本で終えようと思ったら、カーベー・ケージが今年いっぱいで店じまいという情報を得たので一本追加してしまった。これはベーシックなシュトーレンとして最高なので仕方ない。果たして替わりになるシュトーレンは見つかるのだろうか…。</p><h3 id="ダニアレルギー" tabindex="-1">ダニアレルギー <a class="header-anchor" href="#ダニアレルギー" aria-label="Permalink to &quot;ダニアレルギー&quot;">​</a></h3><p>11月半ばに風邪ひいて、そのタイミングでダニアレルギーっぽいことが判明。風邪で喉が荒れていることもあってか、寝室に少しいると今までないくらいの勢いで咳が出るようになった。でも寝室出てしばらくすると収まる。これはダニかなあ、ということで布団乾燥機をダニバスターモードで動かして掃除機かけるようにしたら嘘みたいに咳が出なくなった。ダニアレルギーは色々なアレルギーを悪化させることもある、っていうし、毎日布団乾燥機と掃除機かけるようにしたらこころなしか体調がいい気もする。まあ顕著な症状が出なかったにしても、寝てる間中アレルゲンに触れてたらそりゃ体調も悪くなるよね。</p>',34)])])}const m=e(i,[["render",n]]);export{u as __pageData,m as default};
